import React from 'react'

const Photomyflowers = () => {
  return (
    <div className="image-slider-container-Third">
    <div className="image-slider-Third">
     
     
      
   
      <img src="m1.png" alt="Image 5" />
      <img src="m2.png" alt="Image 4" />
      <img src="m1.png" alt="Image 3" />
 
    </div>
  </div>

  )
}

export default Photomyflowers
